import React from 'react';
import "./home.scss";

const Home = () => {
    return (
        <div className="home">
            <p>
                <span className="hello_text">Hey There!</span>
                <span className="name">I am Jerry Prophete</span>
                <span className="title">Web Developer</span>
            </p>
        </div>
    );
};

export default Home;
